(2, 'Order procedure', 'order-procedure', 'Order procedure', '<div class=\"wpb_text_column wpb_content_element\" bis_skin_checked=\"1\" style=\"margin-bottom: 35px; color: rgb(85, 85, 85); font-family: &quot;open sans&quot;, Helvetica, Arial, sans-serif; outline: none !important;\"><div class=\"wpb_wrapper\" bis_skin_checked=\"1\" style=\"margin-bottom: 0px; outline: none !important;\"><h1 style=\"margin-top: 0px; margin-bottom: 0px; font-size: 36px; outline: none !important;\">কিভাবে অর্ডার করবেন ?</h1></div></div><div class=\"wpb_text_column wpb_content_element\" bis_skin_checked=\"1\" style=\"margin-bottom: 35px; color: rgb(85, 85, 85); font-family: &quot;open sans&quot;, Helvetica, Arial, sans-serif; outline: none !important;\"><div class=\"wpb_wrapper\" bis_skin_checked=\"1\" style=\"margin-bottom: 0px; outline: none !important;\"><h4 style=\"margin-top: 0px; font-size: 18px; outline: none !important;\"><strong style=\"font-weight: bold; margin-bottom: 0px; outline: none !important;\">১.&nbsp;পছন্দের প্রোডাক্ট এ ক্লিক করে ওপেন করুন</strong></h4><h4 style=\"margin-top: 0px; margin-bottom: 0px; font-size: 18px; outline: none !important;\"><strong style=\"font-weight: bold; outline: none !important;\">২. “Ad To Cart” বাটনটিতে ক্লিক করুন,</strong><strong style=\"font-weight: bold; margin-bottom: 0px; outline: none !important;\">&nbsp;</strong></h4><h4 style=\"margin-top: 0px; margin-bottom: 0px; font-size: 18px; outline: none !important;\"><strong style=\"font-weight: bold; margin-bottom: 0px; outline: none !important;\"></strong></h4><h4 style=\"margin-top: 0px; margin-bottom: 0px; font-size: 18px; color: rgb(85, 85, 85); font-family: &quot;open sans&quot;, Helvetica, Arial, sans-serif; outline: none !important;\"><strong style=\"font-weight: bold; margin-bottom: 0px; outline: none !important;\">৩.&nbsp;“Checkout”&nbsp;বাটনটিতে ক্লিক করুন,</strong></h4><h4 style=\"margin-top: 0px; margin-bottom: 0px; font-size: 18px; color: rgb(85, 85, 85); font-family: &quot;open